import './App.css';
import TypeWriter from 'typewriter-effect'



function Heading2() {
  
  return (
  <div className='tracking-wider font-mono text-white text-9xl text-center'> 
      <TypeWriter
        options={{
          loop: true,

        }}
        onInit={(typewriter) => {
          typewriter.pauseFor(2000).typeString("Salam").start().deleteAll(100)
        }}
      />
  </div>
  );
}

export default Heading2;
